				self.german_shepherd.shadow = new createjs.Shadow("#FF9999", 0, 0, 0); // שלא יהיה לכלב היי לייט אחרי לחיצה על איקס
				self.pomernian.shadow = new createjs.Shadow("#FF9999", 0, 0, 0); // שלא יהיה לכלב היי לייט אחרי לחיצה על איקס
